import "./App.css";
import React from "react";
import { connect } from "react-redux";
import { fetchNumbersfromApi } from "./redux/numbers";

class App extends React.Component {
  componentDidMount() {
    this.props.fetchNumbersfromApi();
  }
  render() {
    console.log(typeof this.props.numbers[0][0]);
    return (
      <div className="App">
        <header>
          <h2>Mastermind Game</h2>
        </header>
        <div className="menu">
          <button className="new-game">New Game</button>
          <button className="reset">Reset</button>
          <button className="guess">Guess</button>
        </div>
        <div className="hidden-circles">
          <span className="dot"></span>
          <span className="dot"></span>
          <span className="dot"></span>
          <span className="dot"></span>
        </div>
        <div className="guessed-circles"></div>
        <div className="coloredButton">
          <button className="">blue</button>
          <button className="">red</button>
          <button className="">yellow</button>
          <button className="">green</button>
          <button className="">purple</button>
          <button className="">violet</button>
          <button className="">orange</button>
          <button className="">pink</button>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  console.log(state);
  return {
    numbers: state.sideScores,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    // dispatching plain actions
    fetchNumbersfromApi: () => dispatch(fetchNumbersfromApi()),
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(App);
// export default App;
